{"1": {"comment_id": "_corcordium._"  "comment_text": "Oliver was leaving for the States the second week of August. A few days into the month  he said he wanted to spend three days in Rome and use that time to work on the final draft of his manuscript with his Italian publisher. Then he'd fly directly home. Would I like to join him?
I said yes. Shouldn't I ask my parents first? No need  they never said no. Yes  but wouldn't they...? They wouldn't. On hearing that Oliver was leaving earlier than anticipated and would spend a few days in Rome  my mother asked - with il cauboi's permission  of course - if I might accompany him. My father was not against it.

